import { 
    FC,
    useState 
} from 'react';
import './Main.css';

type TProps = {
    name: string,
}

const CheckBox: FC<TProps> = () => {
    const [checked, setChecked] = useState(true);
    const name = 'Q';

    return(
        <div onClick={() => setChecked(!checked)}>
            <input type="checkbox" checked={checked} />
        <span>{name}</span>
        </div>

    )
}

export default CheckBox;
